    const handleCNPJChange = (event) => {
      const newCNPJ = event.target.value;
      setCNPJ(newCNPJ);
      if (newCNPJ.length !== 14) {
        setErroCNPJ('CNPJ Inválido');
      } else {
        setErroCNPJ('');
